class Solution:
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        hs={}
        for i in range(len(t)):
            if t[i] in hs:
                hs[t[i]].append(i)
            else:
                hs[t[i]]=[i]
        idx=[]
        count=0
        for ss in s:
            if ss in hs:
                for j in range(len(hs[ss])):
                    if (len(idx)>0 and hs[ss][j]>idx[len(idx)-1]) or len(idx)==0:
                        count+=1
                        idx.append(hs[ss][j])
                        break
                        # hs[ss].pop(0)
                        # if len(hs[ss])==0:
                        #     del hs[ss]
                    else:
                        continue
                        # print('missed ='+ss)
                
        if count==len(s):
            return True
        return False
                        
                    
                
